  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:22.269866\",\n\t\"name\": \"alcid-nesting-habitat-on-the-maine-coast\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Maine supports an extensive seabird population
  because of the abundance of relatively inaccessible rocky coastal islands which
  are ideal nesting grounds for many seabird species. No other area in the eastern
  United States has a comparable number of seabird nesting colonies. Most of the offshore
  nesting islands are low-lying granite outcrops or drowned mountaintops. Gulls, cormorants,
  and eiders nest in substantial numbers offshore, while others such as terns, razorbills,
  puffins, and petrels are less common and more sensitive to environmental changes.
  This report reviews the status of the razorbills, puffins, and guillemots in Maine.\",\n\t\"license_title\":
